import React,{useState} from 'react'
import styled from 'styled-components'

function Comment() {

    const CommentBlock = styled.div`
        position:absolute;
        margin: 0 auto;
        .Background {
            background:#f1f4f8;
            padding:12px 20px 20px;
        }
    `
    return (
        <>
            <CommentBlock>
                <div className="Background">
                    <div className="formblock">
                        <form className="form">
                            <div className="inputblock">
                                <input type="text" name="name" className="input" placeholder="필명" />
                                <input type="text" name="password" className="input" placeholder="확인번호" />
                            </div>
                            <textarea className="textarea" placeholder="댓글"></textarea>
                        </form>
                    </div>
                </div>
            </CommentBlock>
        </>

    )
}
export default Comment
